import React from "react";
import { Box, Link } from "@mui/material";
import { Link as RouterLink } from "react-router-dom";
import { BrowserRouter as Router } from "react-router-dom";
import TopPlacesPage from "./components/TopPlacesPage";


const HomePage = () => {
  return (
    <Router>
        <Box
  sx={{
    position: "fixed",
    top: 0,
    width: "100%",
    display: "flex",
    flexDirection: "row",
    justifyContent: "flex-start",
    alignItems: "center",
    backgroundColor: "rgba(153, 255, 0, 1);",
    padding: "10px",
    zIndex: 1,
  }}
>
  <Link
    component={RouterLink}
    to="/"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    Главное
  </Link>
  <Link
  component={Link}
  to="/top-places"
  variant="h6"
  color="common.white"
  sx={{ marginRight: "20px" }}
>
  Топ места
</Link>
  <Link
    component={RouterLink}
    to="/useful-info"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    Полезное
  </Link>
  <Link
    component={RouterLink}
    to="/about"
    variant="h6"
    color="common.white"
    sx={{ marginRight: "20px" }}
  >
    О нас
  </Link>
</Box>
    </Router>
  );
};

export default HomePage;
